import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useParams } from "react-router-dom";

const Career = () => {
  const actorData = useSelector((state) => state.actors.actorCredit.data);

  return (
    <div>
      <div>
        <span>Acting</span>
      </div>
      <div className="grid grid-cols-3 ">
        <span>Year</span>
        <span>Movie / Tv Show</span>
        <span>Role</span>
      </div>
      {actorData.cast?.map((item, index) => {
        return (
          <>
            <span className="border-r w-[15%]">
              {item.release_date && item.release_date
                ? item.release_date.split("-")[0]
                : "-"}
            </span>
            <Link to={`/movie/${item.id}`}>
              <span className="border-r w-[50%]">{item.title}</span>
            </Link>
            <span className="w-[25%]">{item.character}</span>
          </>
        );
      })}
    </div>
  );
};

export default Career;
